import React, { Component } from 'react';
import Artist from './Artist';
import Tracks from './Tracks';
import Search from './Search';
import {connect} from 'react-redux';
import {setTopTracks} from '../actions/musicAction';

class App extends Component{

    state = {artist: null};

    componentDidMount(){
        this.searchArtist("vicetone");
    }

    searchArtist = artistQuery =>{
          fetch(`https://spotify-api-wrapper.appspot.com/artist/${artistQuery}`)
          .then(response => response.json())
          .then(json => {
          if(json.artists.total > 0){
              const artist = json.artists.items[0];
  
              this.setState({artist: artist});
          fetch('https://spotify-api-wrapper.appspot.com/artist/'+this.state.artist.id+'/top-tracks')
          .then(response => response.json())
          .then(json => this.props.setTopTracks(json.tracks) )
          .catch(error => {});
        }

    })
    .catch(error => {});

        }

    render(){
        return(
            <div>
                <h2>Music Master</h2>
                <Search searchArtist={this.searchArtist} />
                <Artist artist={this.state.artist} />
                <Tracks/>
            </div>
        )
    }
}

const mapStateToProps = state => {
    return{
        music: state.musicReducer
    }
}

const mapDispatchToProps = dispatch => {
    return{
        setTopTracks: topTracks =>{
            dispatch(setTopTracks(topTracks));
        }
    }
}


export default connect(mapStateToProps, mapDispatchToProps)(App);
